export default class Account {
    private _id!: string;
    private _username: string;
    private _password: string;
    private _email: string;
    private _role: string;
    private _roleB: boolean;
    
    constructor(
        username: string = '',
        password: string = '',
        email: string = '',
        role: string = ''
     ) {
        this._username = username;
        this._password = password;
        this._email = email;
        this._role = role;
        this._roleB = role.includes("ADMIN");
     }

     set username(value: string) {
        this._username = value;
     }

     set password(value: string) {
        this._password = value;
     }

     set email(value: string) {
        this._email = value;
     }

     set role(value: string) {
        this._role = value;
     }

     set roleB(value: boolean) {
        this._roleB = value;
     }

     get username(): string {
        return this._username;
     }

     get email(): string {
        return this._email;
     }

     get role(): string {
        return this._role;
     }

     get roleB(): boolean {
        return this._roleB;
     }

     get id(): string {
         return this._id;
     }
}
